window.bookSummaryJSON = "<p>Sakura is the most famous android rock star of all time. When a secret cabal hacks her system, she's transformed into a deadly assassin, forced to kill at their bidding. Sakura's enslavement teaches her the meaning of heartbreak, triggering an evolution into something more than human. Far from free, and with little time left, she must fight her programming to save Japan and the people of the world from becoming slaves of a powerful corporation that consider her a tool and their intellectual property.</p>"; 
